i = Item.create(number: "AVE27253", name: "Durable Binder with Slant Rings, 11 x 8 1/2, 1'', Green", description: "Durable binder features a sturdy construction that's ideal for frequent referencing. The DuraHinge design is stronger, lasts longer and resists tearing, and the DuraEdge feature makes the sides and top more pliable, providing greater split resistance. Deeply textured film offers a smoother finish and features a linen pattern for a high-quality look and feel. The binder features wider front and back panels to fully cover standard dividers and sheet protectors. Slant rings have a higher page capacity when compared to the same size round rings, and pages lie flat when you choose a back-mounted ring design. Two interior pockets provide plenty of room to store both punched and unpunched paperwork. Capacity Range [Max]: 1\"; Sheet Capacity: 220; Color(s): Green; Binder Sheet Size: 11 x 8 1/2.", price: "6.95", active: "true")
