i = Item.create(number: "AVE3379", name: "Textured Note Cards, Inkjet, 4 1/4 x 5 1/2, Uncoated White, 50/Bx w/Envelopes", description: "Who can resist the sizzling colors and sharp details that you can create on these Note Cards? Get your business or organization noticed with easy-to-fold note cards that command a second look. There's sure to be a free design or template at Avery Design & Print that expresses your vision of success. Design, print, fold and voila—dazzling cards from your printer in seconds. Print on both sides to maximize your advertising potential. Or leave the inside blank to handwrite names and phone numbers. Design in portrait or landscape orientation and stand them on a table at a convention, or pass them out or mail them for instant attention. Convenient do-it-yourself cards mean that you can make changes and print new cards at a moment's notice. This product was made from wood sourced from a certified managed forest. 8 1/2\" x 11\" sheets. Paper Color(s): Textured Uncoated White; Card Height: 4 1/4\"; Card Width: 5 1/2\"; Cards Per Sheet: 2.", price: "17.95", active: "true")
