i = Item.create(number: "AVE16150", name: "Door Hanger w/Tear-Away Cards, 4 1/4 x 11, Matte White, 10/Sheet, 40 Sheets/Pack", description: "Open the door to success! Customizable, two-sided Door Hangers with Tear-Away Cards let you take your message right to your customers' front door. Each 4 1/4\" x 11\" hanger is made of sturdy cardstock and features two tear-away 3 1/2\" x 2\" cards for seasonal promotions, discounts or rewards that can be kept by your customers for future use. Whether you want to offer coupons, rewards or business cards, you can easily personalize each element to fit your marketing needs. The cards fold and pull apart with ease, so no scissors are needed. Visit Avery® Design & Print to choose from an array of complimentary designs, QR codes and templates to create your own unique message. It's never been easier to get your foot in the door. Easily create different messages and seasonal promotions to attract customers. This product was made using wood sourced from a certified managed forest. Size: 4 1/4\" x 11\"; Paper Color(s): White; Paper Weight: 65 lbs; Sheets Per Unit: 40.", price: "15.95", active: "true")
