i = Item.create(number: "AVE2162", name: "Mini-Sheets Address Labels, 1 1/3 x 4, White, 150/Pack", description: "No job's too big —or too small. When you only need a few labels to do the job instead of an entire sheet, show your efficient side with Mini-Sheets®. Simply input and format your custom text using free templates from Avery® Design & Print. Next, manually feed the entire sheet though your printer. Peel off only as many labels as you need, or use even fewer labels by folding and separating along the perforation. The result: the same high-quality, professional-looking labels as full-sheet formats, proving that a little bit can still go a long way. This product was made using wood sourced from a certified managed forest. Label Size - text: 1 1/3 x 4; Label Color(s): White; Machine Compatibility: Inkjet Printers; Laser Printers; Sheet (W x L): 4 1/4 x 10.", price: "8.95", active: "false")
